(30, 1, '2023-05-02 21:30:14', '2023-05-02 15:30:14', 'Essentials fleece 3-stripes full-zip hoodie\r\n\r\n<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\r\n\r\nThis product is excluded from all promotional discounts and offers.', 'Hoodie', 'A classic 3-stripes hoodie made in part with recycled content.\r\nObjects in motion stay in motion. Even after practice is wrapped up, you want the same freedom to move through life with ease. This adidas hoodie has you covered. Soft fleece feels good against the skin, which means fewer distractions and more comfort. Go about your routine without a single roadblock.', 'publish', 'open', 'closed', '', 'hoodie', '', '', '2023-05-19 13:59:41', '2023-05-19 07:59:41', '', 0, 'https://localhost/Shuvro/?post_type=product&#038;p=30', 0, 'product', '', 4),
