(71, 'payoneer_q2_2023', 'marketing', 'en_US', 'Grow with the next generation of payment processing', 'Ready to stand out in the new global economy? Payoneer Checkout gives you the power to securely accept payments worldwide, build a checkout that customers love, and manage your store’s transactions and finances – all from the same place.', '{}', 'unactioned', 'woocommerce.com', '2023-05-15 08:10:16', NULL, 0, 'plain', '', 0, 1, 'info'),
(72, 'wc-admin-customize-store-with-blocks', 'info', 'en_US', 'Customize your online store with WooCommerce blocks', 'With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-16 15:24:22', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'ipp_refresh_q2_2023_us_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the M2 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'pending', 'woocommerce.com', '2023-05-18 15:46:29', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'ipp_refresh_q2_2023_ca_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the WisePad 3 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'pending', 'woocommerce.com', '2023-05-18 15:46:29', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'product_management_card_sorting', 'survey', 'en_US', 'How do you create and edit products?', 'Have a say in the future of WooCommerce. Take part in a brief exercise and help us understand what information is important to you while editing products.', '{}', 'unactioned', 'woocommerce.com', '2023-05-18 15:46:29', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'wc-admin-coupon-page-moved', 'update', 'en_US', 'Coupon management has moved!', 'Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-19 12:02:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(78, 'wc-admin-orders-milestone', 'info', 'en_US', 'First order received', 'Congratulations on getting your first order! Now is a great time to learn how to manage your orders.', '{\"current_milestone\":1}', 'unactioned', 'woocommerce-admin', '2023-05-22 15:59:31', NULL, 0, 'plain', '', 0, 0, 'info');
